import Navbar from  './Components/Navbar'
import './App.css';
import News from './Components/News';
import{
  BrowserRouter as Router,
  Switch as s,
Route,
Link,

}from "react-router-dom";


function App() {
  return (
    <>
    <Router>
      <Navbar/>


      <Switch>
          <Route exact path="/About" element={<h1>About</h1>} ><News country={"us"} category ={"About"}/></Route>
          <Route exact path="/Business" element={<h1>Business</h1>} ><News country={"us"} category ={"Business"}/></Route>
          <Route exact path="/Entertainment" element={<h1>Entertainment</h1>} ><News country={"us"} category ={"Entertainment"}/></Route>
          <Route exact path="/General" element={<h1>General</h1>} ><News country={"us"} category ={"General"}/></Route>
          <Route exact path="/Health" element={<h1>Health</h1>} ><News country={"us"} category ={"Health"}/></Route>
          <Route exact path="/Science" element={<h1>Science</h1>} ><News country={"us"} category ={"Science"}/></Route>
          <Route exact path="/Sports" element={<h1>Sports</h1>} ><News country={"us"} category ={"Sports"}/></Route>
          <Route exact path="/Technology" element={<h1>Technnology</h1>} ><News country={"us"} category ={"Technology"}/></Route>

        </Switch>


      </Router>

    </>

  );
}

export default App;
